import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Register from './Resources/register';
import FirstPage from './Resources/starting';
import Account from './Resources/account';
import LogIn from './Resources/Index/LogIn';
import './App.css';
import { connect } from 'react-redux';
import { setAuthed } from './Resources/action/action';




function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<FirstPage/>} />
        <Route path="/register" element={<Register />} />
        <Route path="/account" element={this.auth.authed ? <Account /> : <FirstPage />} />
      </Routes>
    </Router>
  );
}

const mapDispatchToProps = {
  setAuthed,
};

export default connect(null, mapDispatchToProps)(App);
